//상단바 (Frame) 와 Footer 함수가 정의되어 있음

import './frame.css';
import {Logo, LogoAdd} from '../../logo.js';
import { Component } from 'react';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';


function 아래화살표(){
  return (
    <img src="iconDown.png"
    width="10px"/>
  );
}


function 네비네비게이션({i}){

  const sub네비게이션 =[{
    gate1:'인사말',
    gate2:'홈페이지 안내'
  },
  {
    gate1:'공지사항',
    gate2:'커뮤니티'
  }
];

  return(
    <nav id="subNav">
      <ul>
        <li>{sub네비게이션[0].gate1}</li>
        <li>{sub네비게이션[1].gate2}</li>
        <li></li>
      </ul>
    </nav>
  );
}


export class Frame extends Component{

  constructor(props){
    super(props);
    this.state={
      bar: ''

    }
  }
  // 'bar'를 만든다고 합시다. 무언가 bar의 state가 있다.
  // bar는 보였다가 안보였다가 해야겠죠? 동시에 빠지기도 해야함.
  // div안의 내용을 바꿀 수 있는 녀석이어야함.
  // bar의 내용도 2개가 다 달라야합니다.


    render(){
    return(
        <div>
          <div id="user">
            <a href="/login" className ="topNav">로그인</a>
            <a href="/account" className ="topNav">회원가입</a>
          </div>
          <div id="menu">
            <LogoAdd/>
            <nav id ="mainNav">
              <ul className = "horizontal-list">
                <li><a to="/서비스소개">서비스 소개 <아래화살표/> </a></li>
                <li><a to="/게시판">게시판 <아래화살표/> </a></li>
                <li><a href="/update.html">데이터 업로드 <아래화살표/> </a></li>
              </ul>
            </nav>
          </div>
        </div>

    );
  }
}

export function Banner({name}){

return (
    <div class="banner">
      <h1>{name}</h1>
      <img src="banner.jpg"/>
    </div>
);
}

export function ContentNav({name}){
  return (
    <nav className="contentNav">
        <ul>
            <li id="iconHome">
                <a href="./">
                    <img src="iconHome.png" width="20px"/>
                </a>
            </li>
            <li className="contentNav한칸">
                <a href="./">
                    <p>{name}</p>
                    <아래화살표/>
                </a>
            </li>
            <li className="contentNav한칸">
                <a href="./">
                    <p>인사말</p>
                    <아래화살표/>
                </a>
            </li>
        </ul>
    </nav>
    );
}


export function Footer(){
  return(
      <div className='footer'>
          <div className="footerBox">
              <Logo/>
              <div>
                  <div className="footerInfo">
                      <div>서울시 광진구 능동로 209 세종대학교</div>
                      <div>TEL : 010-@@@@-@@@@</div>
                      <div>Email : @sju.ac.kr</div>
                  </div>
                  <div>Copyright@ 2023 Sejong RDD | All Rights Reserved</div>
              </div>
          </div>
      </div>
  );
}
